INSERT INTO `BODYCONTENT` VALUES (131073,'<p><br />You can start a discussion by simply leaving a comment on a page, like this one.<br />Why not give it a try?<br />&nbsp;</p><p>Go to the bottom of this page and find the comment area at the bottom.<br />Click into the text area and type something. Then, when you\'re finished just press save!&nbsp;</p><p><strong>Hint:</strong> You can mention another user in a comment by typing @ and then the user\'s name. That user will then receive a notification.</p><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><ac:link><ri:page ri:content-title=\"Learn the wonders of autoconvert (step 7 of 9)\" /><ac:link-body><ac:image ac:height=\"40\" ac:width=\"106\"><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Share your page with a team member (step 9 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p>',98306,2),(131074,'<p><span style=\"color: rgb(0,0,0);\"><strong>kick9 wiki</strong></span></p><p><span style=\"color: rgb(0,0,0);\"><strong></strong></span></p><p><span style=\"color: rgb(0,0,0);\"><strong></strong></span></p><p><span style=\"color: rgb(0,0,0);\"><strong><br /></strong></span></p><p><span style=\"color: rgb(0,0,0);\"><strong><br /></strong></span></p><p><span style=\"color: rgb(0,0,0);\"><strong><br /></strong></span></p><p><span style=\"color: rgb(0,0,0);\"><strong><br /></strong></span></p><p style=\"text-align: right;\"><span style=\"color: rgb(0,0,0);\"><strong>&nbsp; &nbsp; &nbsp;&nbsp;</strong></span></p>',98311,2),(131075,'<p><span style=\"color: rgb(64,64,64);\"><br /></span></p><p><span style=\"color: rgb(64,64,64);\">Once you\'ve created content you\'ll want to share it with your team members.&nbsp;<br /></span><span style=\"color: rgb(64,64,64);\">Confluence can do all the work for you. Just click <strong>Share</strong> and enter recipients and a brief message.<br /></span></p><p style=\"margin-left: 30.0px;\"><span style=\"color: rgb(64,64,64);\"><span style=\"color: rgb(64,64,64);\"><br /></span></span></p><ol><li>Let\'s tell someone about this page. <br />Click the <strong>Share</strong> button at the top right of the page. It looks like this:<br /><ac:image><ri:attachment ri:filename=\"step09-00.jpg\" /></ac:image>&nbsp;<br />&nbsp;</li><li>Type the email address of the person with whom you want to share the page. <br />If the person already has a Confluence username, you can just type their name. <br /><ac:image><ri:attachment ri:filename=\"step09-01.jpg\" /></ac:image><br /><br /></li><li>Add a message to give the person some background about the page.<br /><ac:image><ri:attachment ri:filename=\"step09-02.jpg\" /></ac:image><br /><br /></li><li>Click the <strong>Share</strong> button. <br />Confluence will send the person an email message about this page. Shared!</li></ol><p>&nbsp;</p><p>&nbsp;</p><p><ac:emoticon ac:name=\"warning\" /><span style=\"color: rgb(64,64,64);\"> The </span><strong>Share</strong><span style=\"color: rgb(64,64,64);\"> button will appear only if you have configured a mail server in the Confluence Administration Console. (This does not apply to Confluence OnDemand.)</span></p><ac:macro ac:name=\"expand\"><ac:parameter ac:name=\"title\">Click here to see the \'Share\' button in action!</ac:parameter><ac:rich-text-body><p style=\"margin-left: 30.0px;\"><ac:macro ac:name=\"widget\"><ac:parameter ac:name=\"url\">http://www.youtube.com/watch?v=ynzbEKFrjqE</ac:parameter></ac:macro></p></ac:rich-text-body></ac:macro><p style=\"margin-left: 30.0px;\"><span style=\"color: rgb(64,64,64);\"><br /></span></p><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Tell people what you think in a comment (step 8 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;</span></h1><p style=\"margin-left: 30.0px;\"><span style=\"color: rgb(51,51,51);\"><br /></span></p>',98313,2),(131076,'<p style=\"margin-left: 60.0px;\">&nbsp;</p><p><strong>Pages are the primary means of storing and sharing information in Confluence.</strong> <br />Pages are contained within spaces. This page is in the \'Demonstration Space\'.&nbsp;<br />&nbsp;</p><p>Let\'s play with some content. Don\'t worry, you won\'t break anything:</p><ol><li>Click&nbsp;<strong>Edit</strong> at the top of this page. Now you are in the editor.</li><li>Type some words in the panel below this one.</li><li>Have some fun:<span style=\"line-height: 0.0px;\">&nbsp;</span></li></ol><ul><li style=\"list-style-type: none;\"><ul><li>Change the color of some text: Select the text, then choose a color from the color option in the editor tool bar.</li><li>Add a link: Select some text, then choose <strong>Insert</strong> &gt;&nbsp;<strong>Link</strong> (or press Ctrl+K or Cmd+K). <br />Click <strong>Web Link</strong> and enter an <strong>Address</strong>, such as&nbsp;<code>http://www.google.com</code>. <br />Click <strong>Insert</strong> to insert the link and come back to this page.</li><li>Find a pretty picture on your computer\'s local or network drive, and drag it into the same panel as your words.</li><li>Try the other options in the editor toolbar.</li></ul></li></ul><p style=\"margin-left: 60.0px;\">&nbsp;</p><p>When<em> y</em>ou are ready, click&nbsp;<strong>Save</strong> and go to the next step or back to the space home.</p><p>&nbsp;</p><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"A quick look at the editor (step 2 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\" /></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\" /></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Prettify the page with an image (step 4 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\" /></ac:image></ac:link-body></ac:link></span></h1><p>&nbsp;</p>',98305,2),(131077,'<div class=\"contentLayout\" data-atlassian-layout=\"{&quot;name&quot;:&quot;pagelayout-two-right&quot;,&quot;columns&quot;:[&quot;large&quot;,&quot;aside&quot;],&quot;header&quot;:true,&quot;footer&quot;:true}\"><div class=\"header\"><div class=\"innerCell\"><p style=\"margin-left: 60.0px;\">&nbsp;</p><p><span style=\"color: rgb(51,51,51);\">The Confluence editor has been built to create content, fast. But that doesn\'t just mean using the written word, creating lists, or inserting links.&nbsp;<br /></span><span style=\"color: rgb(51,51,51);\">You can embed images, Office documents, and videos&nbsp;&ndash; and that is just the tip of the iceberg when it comes to creating useful content for your teammates.&nbsp;<br />&nbsp;</span></p></div></div><div class=\"columnLayout twoColumns\"><div class=\"cell large\"><div class=\"innerCell\"><ol><li style=\"text-align: left;\"><strong>Edit</strong> the page.</li><li style=\"text-align: left;\">Click in the right-hand column to position your cursor.</li><li style=\"text-align: left;\">Click the <strong>Insert</strong> button in the editor toolbar. It looks like this:<br /><ac:image><ri:attachment ri:filename=\"step04-00.jpg\" /></ac:image><br /><br /></li><li style=\"text-align: left;\">Choose <strong>Image</strong> to launch the \'Insert Image\' dialog.<br /><ac:image><ri:attachment ri:filename=\"step04-01.jpg\" /></ac:image><br /><br /></li><li style=\"text-align: left;\"><span>The \'Attached Images\' tab shows you the images attached to this page. <br />Click the image named&nbsp;<strong>Confluence Origami Necktie</strong>.<br /></span></li><li style=\"text-align: left;\">Click <strong>Insert</strong>.</li><li style=\"text-align: left;\"><span style=\"color: rgb(51,51,51);\">You will return to this page, and see the \'Image Properties Panel\'. If you don\'t see it, click the image.</span></li><li style=\"text-align: left;\"><span style=\"color: rgb(51,51,51);\">You can resize the image by clicking on the square buttons.<br /><ac:image><ri:attachment ri:filename=\"step04-02.jpg\" /></ac:image>&nbsp;<br /></span><span style=\"color: rgb(51,51,51);\"><br /></span></li><li style=\"text-align: left;\"><span style=\"color: rgb(51,51,51);\">Click <strong>Effects</strong> and then select the <strong>Curl Shadow</strong> option from the \'Image Effects\' dialog.&nbsp;<br /><ac:image><ri:attachment ri:filename=\"step04-03.jpg\" /></ac:image>&nbsp;<br />&nbsp;</span></li><li style=\"text-align: left;\"><span style=\"color: rgb(51,51,51);\">Your image should look like this when completed:<br /><ac:image ac:queryparams=\"effects=border-simple,shadow-kn\" ac:thumbnail=\"true\" ac:width=\"300\"><ri:attachment ri:filename=\"Confluence-Origami-Necktie.jpeg\" /></ac:image><br />&nbsp;</span></li><li style=\"text-align: left;\">Click <strong>Save</strong> to save the page.<br /><ac:image><ri:attachment ri:filename=\"step04-04.jpg\" /></ac:image></li></ol></div></div><div class=\"cell aside\"><div class=\"innerCell\"><p>&nbsp;</p></div></div></div><div class=\"footer\"><div class=\"innerCell\"><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Get serious with a table (step 5 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p></div></div></div>',98307,2),(131078,'<p style=\"margin-left: 60.0px;\">&nbsp;</p><p><strong>Confluence is a collaboration tool</strong> where you can create and share content with your team. <br />You might use Confluence to write and discuss meeting notes, project plans, requirements, how-to guides, or anything you like.<br /><br />In a nutshell, Confluence allows you to publish web pages that you can <strong>read and edit online</strong> via a web browser. <br />You can create something as simple as text on a page. Or add images, diagrams, activity streams, videos, and more. <br />Confluence puts your content online in a central place where your team can search, edit and discuss it at any time.<br />&nbsp;</p><p><span><span style=\"color: rgb(0,0,0);\">So let\'s try it!<span style=\"color: rgb(0,0,255);\">&nbsp;<ac:link><ri:page ri:content-title=\"A quick look at the editor (step 2 of 9)\" /><ac:plain-text-link-body><![CDATA[Click here to learn how to edit a page]]></ac:plain-text-link-body></ac:link></span>&nbsp;<ac:emoticon ac:name=\"wink\" /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\">&nbsp;</span></span></p><h1 style=\"text-align: center;\"><ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"A quick look at the editor (step 2 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p><p><span style=\"color: rgb(51,51,51);\"><br /></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p>',98312,2),(131079,'<div class=\"contentLayout\" data-atlassian-layout=\"{&quot;name&quot;:&quot;pagelayout-two&quot;,&quot;columns&quot;:[&quot;&quot;,&quot;&quot;],&quot;header&quot;:true,&quot;footer&quot;:true}\"><div class=\"header\"><div class=\"innerCell\"><p style=\"margin-left: 60.0px;\"><span style=\"color: rgb(64,64,64);\"><br /></span></p><p><span style=\"color: rgb(64,64,64);\">Confluence automatically transforms linked content&nbsp;<span style=\"color: rgb(64,64,64);\"> into rich content.</span> Try it with Confluence pages, JIRA issues, YouTube videos,&nbsp;<br /></span><span style=\"color: rgb(64,64,64);\">CloudApp content, Flickr and OpenPhoto photo streams, Vimeo videos, and Google maps.<br /></span></p><p><span style=\"color: rgb(64,64,64);\"><span style=\"color: rgb(64,64,64);\">You have to see it to believe it!<br />Below you will find two examples of autoconvert in action.</span></span></p><p style=\"margin-left: 60.0px;\"><span style=\"color: rgb(64,64,64);\"><span style=\"color: rgb(64,64,64);\"><br /></span></span></p><p style=\"margin-left: 60.0px;\"><span style=\"color: rgb(64,64,64);\"><span style=\"color: rgb(64,64,64);\"><br /></span></span></p></div></div><div class=\"columnLayout twoColumns\"><div class=\"cell \"><div class=\"innerCell\"><div><ac:macro ac:name=\"widget\"><ac:parameter ac:name=\"url\">http://youtube.com/watch?v=sKxyGvMXdII</ac:parameter></ac:macro></div><div><span style=\"color: rgb(51,51,51);\"><br /></span></div><div><span style=\"color: rgb(51,51,51);\"><span style=\"color: rgb(51,51,51);\">&nbsp;</span></span><h3><span style=\"color: rgb(51,51,51);\">How to do it yourself:</span></h3></div><ol><li><span><span><span style=\"color: rgb(51,51,51);\"><span><strong>Edit</strong>&nbsp;the page.</span></span></span></span></li><li><span><span><span style=\"color: rgb(51,51,51);\"><span>Copy this link to your clipboard:&nbsp;<a href=\"http://youtu.be/sKxyGvMXdII\">http://youtu.be/sKxyGvMXdII</a></span><br /></span></span></span></li><li><span style=\"color: rgb(51,51,51);\">Paste the link onto the page.</span></li><li><span style=\"color: rgb(51,51,51);\">Autoconvert will&nbsp;embed the YouTube video on the page.</span></li><li><span style=\"color: rgb(51,51,51);\">Save the page the video in place.&nbsp;</span></li></ol></div></div><div class=\"cell \"><div class=\"innerCell\"><p><span style=\"color: rgb(0,0,0);\"><ac:macro ac:name=\"widget\"><ac:parameter ac:name=\"url\">https://maps.google.com/maps?q=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;hl=en&amp;ll=-33.866572,151.207001&amp;spn=0.004321,0.008256&amp;sll=-33.870509,151.203707&amp;sspn=0.008641,0.016512&amp;oq=atlassian,&amp;hq=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;radius=15000&amp;t=m&amp;z=18&amp;iwloc=A</ac:parameter></ac:macro></span></p><p><span style=\"color: rgb(0,0,0);\"><br /></span></p><h3><span style=\"color: rgb(51,51,51);\"><span style=\"color: rgb(51,51,51);\">How to do it yourself</span>:</span></h3><ol><li><strong>Edit</strong>&nbsp;the page.</li><li>Copy this link to your clipboard:&nbsp;<a href=\"https://maps.google.com/maps?q=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;hl=en&amp;ll=-33.866572,151.207001&amp;spn=0.004321,0.008256&amp;sll=-33.870509,151.203707&amp;sspn=0.008641,0.016512&amp;oq=atlassian,&amp;hq=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;radius=15000&amp;t=m&amp;z=18&amp;iwloc=A\">https://maps.google.com/maps?q=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;hl=en&amp;ll=-33.866572,151.207001&amp;spn=0.004321,0.008256&amp;sll=-33.870509,151.203707&amp;sspn=0.008641,0.016512&amp;oq=atlassian,&amp;hq=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;radius=15000&amp;t=m&amp;z=18&amp;iwloc=A</a></li><li>Paste the link onto the page</li><li>Autoconvert will render the Google Maps view on the page.</li><li><span style=\"color: rgb(51,51,51);\">Save the page the map in place.&nbsp;</span></li></ol></div></div></div><div class=\"footer\"><div class=\"innerCell\"><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Lay out your page (step 6 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Tell people what you think in a comment (step 8 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p></div></div></div>',98310,2),(131080,'<div class=\"contentLayout\" data-atlassian-layout=\"{&quot;name&quot;:&quot;pagelayout-two-right&quot;,&quot;columns&quot;:[&quot;large&quot;,&quot;aside&quot;],&quot;header&quot;:true,&quot;footer&quot;:true}\"><div class=\"header\"><div class=\"innerCell\"><p style=\"margin-left: 60.0px;\">&nbsp;</p><p>Insert new tables with drag and drop simplicity. <br />Add, remove, cut, and paste rows and columns &ndash; this makes working with tables easy.&nbsp;</p><p>&nbsp;</p></div></div><div class=\"columnLayout twoColumns\"><div class=\"cell large\"><div class=\"innerCell\"><ol><li><span style=\"color: rgb(51,51,51);\"><strong>Edit</strong>&nbsp;the page.</span></li><li><span style=\"color: rgb(51,51,51);\">Click in the right-hand column to position your cursor.</span></li><li>Click <strong>Table</strong> in the editor toolbar. It looks like this:<br /><ac:image><ri:attachment ri:filename=\"step05-00.jpg\" /></ac:image><br /><br /></li><li>Using the table dropdown, select a table size by moving your mouse over the table diagram.<br /><ac:image><ri:attachment ri:filename=\"step05-01.jpg\" /></ac:image><br /><br /></li><li>Upon inserting the table on to the page, you will see a contextual table toolbar.<br /><ac:image><ri:attachment ri:filename=\"step05-02.jpg\" /></ac:image><br /><br /></li><li>Place your cursor in the first cell of the table and add a row below it.<br /><ac:image><ri:attachment ri:filename=\"step05-03.jpg\" /></ac:image><br /><br /></li><li>Place your cursor in any cell of the last column of the table and delete the column.<br /><ac:image><ri:attachment ri:filename=\"step05-04.jpg\" /></ac:image><br /><br /></li><li>Your table should look like this:<br /><ac:image><ri:attachment ri:filename=\"step06-06.jpg\" /></ac:image><br /><br /></li><li><span style=\"color: rgb(51,51,51);\">Click </span><strong style=\"color: rgb(51,51,51);\">Save</strong><span style=\"color: rgb(51,51,51);\">.</span><br /><span style=\"color: rgb(51,51,51);\">&nbsp;</span></li></ol></div></div><div class=\"cell aside\"><div class=\"innerCell\"><p>&nbsp;</p></div></div></div><div class=\"footer\"><div class=\"innerCell\"><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Prettify the page with an image (step 4 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Lay out your page (step 6 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1></div></div></div>',98314,2),(131081,'<p>&nbsp;</p><p>You will use the Confluence editor to <strong>create</strong> and <strong>edit</strong> Confluence pages.<br />You can type into the editor as you would in any document, apply formatting, and embed other content and files into the page.</p><p style=\"margin-left: 30.0px;\"><br /><span style=\"color: rgb(51,51,51);\">The editor looks like this <span style=\"color: rgb(153,153,153);\">(click on images to expand)</span>:</span><br /><ac:image ac:queryparams=\"effects=border-simple,blur-border\" ac:width=\"600\"><ri:attachment ri:filename=\"step-2-image-1-confluence-demo-space.png\" /></ac:image></p><p>&nbsp;</p><h2><span style=\"color: rgb(0,0,0);\">Here is a description of the components:</span></h2><ol><li><h3><span style=\"color: rgb(0,0,0);\">Page title</span></h3><span style=\"color: rgb(51,51,51);\">Use the page title to give your page a unique name that describes it.</span><br /><span style=\"color: rgb(0,0,0);\"><ac:image ac:queryparams=\"effects=border-simple,blur-border\" ac:width=\"600\"><ri:attachment ri:filename=\"step-2-image-2-confluence-demo-space.png\" /></ac:image></span><br /><br /></li><li><h3><span style=\"color: rgb(0,0,0);\">Editor toolbar</span></h3><span style=\"color: rgb(51,51,51);\">The editor toolbar provides tools to format and color page content, create lists and tables, indent and align text, and insert other content into the page such as symbols, links, images, multimedia files, and macros.</span><br /><span style=\"color: rgb(0,0,0);\"><ac:image ac:queryparams=\"effects=border-simple,blur-border\" ac:width=\"600\"><ri:attachment ri:filename=\"step-2-image-3-confluence-demo-space.png\" /></ac:image></span><br /><br /></li><li><h3><span style=\"color: rgb(0,0,0);\">Page content</span></h3><span style=\"color: rgb(51,51,51);\">This is where you will type the content for your page. You can also drag attachments from your desktop here. In the screenshot below you can see content for a Planning Meeting Notes page.</span><br /><span style=\"color: rgb(0,0,0);\"><ac:image ac:queryparams=\"effects=border-simple,blur-border\" ac:width=\"600\"><ri:attachment ri:filename=\"step-2-image-4-confluence-demo-space.png\" /></ac:image></span><br /><br /></li><li><h3><span style=\"color: rgb(0,0,0);\">Save button</span></h3><span style=\"color: rgb(0,0,0);\">Clicking the Save button &quot;publishes&quot; the page so that others can see your changes.</span><br /><span style=\"color: rgb(0,0,0);\"><ac:image ac:queryparams=\"effects=border-simple,blur-border\" ac:width=\"600\"><ri:attachment ri:filename=\"step-2-image-5-confluence-demo-space.png\" /></ac:image></span><br /><br /></li></ol><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"What is Confluence? (step 1 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p>',98309,2),(131082,'<p>&nbsp;</p><p>Page layouts provide structure to your page &mdash; two-column, three-column, and more &mdash; making it&nbsp;<br />easy for everyone in your organization, first-time and power users alike, to create beautiful pages.</p><p>&nbsp;</p><ol><li><span style=\"color: rgb(51,51,51);\"><strong>Edit</strong>&nbsp;the page.</span></li><li><span style=\"color: rgb(51,51,51);\">Click the <strong>Page Layout</strong></span> button in the editor toolbar. It looks like this:<br /><span style=\"color: rgb(51,51,51);\"><ac:image><ri:attachment ri:filename=\"step07-00.jpg\" /></ac:image>&nbsp;<br />&nbsp;</span></li><li><span style=\"color: rgb(51,51,51);\">Select the <strong>Two-Column</strong></span> page layout.<br /><span style=\"color: rgb(51,51,51);\"><ac:image><ri:attachment ri:filename=\"step07-01.jpg\" /></ac:image><br /><br /></span></li><li><span style=\"color: rgb(51,51,51);\">Select the <strong>Three-Column with Header and Footer</strong></span><span style=\"color: rgb(51,51,51);\"> page layout.</span><br /><span style=\"color: rgb(51,51,51);\"><ac:image><ri:attachment ri:filename=\"step07-02.jpg\" /></ac:image><br />&nbsp;</span></li><li><span style=\"color: rgb(51,51,51);\">Use your cursor (or press </span>Ctrl+A or Cmd+A)<span style=\"color: rgb(51,51,51);\"> to highlight all the content in this page layout block.</span></li><li><span style=\"color: rgb(51,51,51);\">Copy and paste this content into the center and right-hand content blocks.</span></li><li>Click <strong>Save</strong>.</li></ol><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Get serious with a table (step 5 of 9)\" /><ac:link-body><ac:i